import React from "react";
import { FILTER } from "../../constants/filter";

const Filter = () => {
  return (
    <div className="filters">
      {Object.keys(FILTER).map((title) => {
        <div>{title}</div>;
      })}
    </div>
  );
};
export default Filter;
